{'es-ES': 'EXCELENTE PISO EN LA MEJOR ZONA DE VALGAÑON, CON TRES HABITACIONES Y DOS\xa0BAÑOS, GRAN COCINA Y SALÓN CON AMPLIOS VENTANALES.\xa0

HABITACION\xa0PRINCIPAL CON BAÑO EN SUITE,\xa0

A TAN SOLO CINCO MINUTOS DE EZCARAY, EN UN ENTORNO NATURAL ENVIDIABLE.'}

{'es-ES': 'DUPLEX CON TERRAZA Y VISTAS DESPEJADAS

3 HABITACIONES, SALÓN, COCINA Y DOS BAÑOS.

PLAZA DE GARAJE INCLUIDA EN EL PRECIO'}

{'es-ES': 'Situada en Corera, muy bien comunicada con Logroño (28km) y Calahorra (25km) y en pleno corazón del Valle de Ocón, se vende casa independiente en finca urbana de 1382 metros cuadrados, rodeada de huerta y árboles frutales. Cuenta con la ventaja de estar dentro del casco urbano del pueblo para poder disfrutar de todos los servicios municipales y la vez rodeada de naturaleza y con excelentes vistas a toda la comarca.

Se trata de una casa de dos plantas con entrada independiente. En la planta principal se encuentra la vivienda de 105 metros cuadrados y en la planta baja una zona de merendero con chimenea y bodega, garaje y almacén, con un total de 159 metros cuadrados.

La vivienda cuenta con una amplia cocina con despensa, un salón comedor con chimenea de leña, 4 dormitorios, 2 baños reformados y una amplia terraza con orientación este y excelentes vistas.'}

{'es-ES': 'En venta casa en Recajo-Agoncillo a 10 minutos de Logroño, de dos plantas con jardín privado y cochera. Se distribuye de la siguiente manera:\xa0

Planta Baja: Salón, dormitorio, cocina - merendero de gran tamaño con estufa de pellet y salida a jardín.\xa0 Jardín de gran tamaño con zona de huerta, 3 cuartos trasteros, barbacoa y cochera con portón para vehículo.

Planta Primera: Vivienda de 3 dormitorios, uno de ellos cuenta con balcón, cocina equipada, salón y cuarto de baño completo. Suelos de parquet. Calefacción en planta primera con radiadores eléctricos.\xa0'}

{'es-ES': 'La vivienda, ubicada en la salida del pueblo, se desarrollan en planta semisótano, baja y primera. Su orientación es Norte-Sur. 

La superficie útil total de la vivienda, garaje, local, etc…es de 140,51 m2. En el semisótano se encuentran el garaje y el local-bodeguita con acceso exterior independiente a cada uno de los ámbitos e intercomunicados entre sí, así como un trastero. En la planta baja está el acceso principal a la vivienda y se ubican el salón con una amplia terraza, la cocina con galería y un aseo. En la planta primera se alojan tres dormitorios, dos de los cuales dan a una terraza, y un baño completo. 

Tanto la calefacción como el ACS es de tipo central con control y contadores individuales.'}

{'es-ES': 'Vivienda de tres dormitorios con garaje y trastero incluido en el precio. 

Este edificio se encuentra en una zona de nueva urbanización en el municipio de agoncillo cerca de infraestructuras urbanas como el polideportivo. Su ubicación privilegiada permite estar en el centro del pueblo a 7 minutos a pie y dispone de unas amplias vistas de la vega del río Ebro. En sus bajos se encuentra un centro de salud y una biblioteca municipal. 

El edificio, de delicado diseño arquitectónico, está perfectamente integrado en el entorno. Se compone de 4 plantas (planta baja y tres alzadas) por medio de 5 portales a los que se acceden desde la calle Polideportivo y Santa Águeda. .'}

{'es-ES': 'TENEMOS ESTA CONSTRUCCION DE OBRA NUEVA DE CUATRO PLANTAS,\xa0 EL EDIFICIO ESTA PLANTEADO PARA\xa0 APARTAMENTOS EN LAS DIFERENTE PLANTAS A TERMINAR A GUSTO.

SITUACIÓN\xa0 PRIVILEGIADA EN EL CENTRO, CALLE AMPLIA

¡¡ESPECIAL INVERSORES, VEN A VERLO!!'}

{'es-ES': 'Magnífica promoción de viviendas situada en el municipio de Rodezno, provincia de La Rioja. Se comercializan viviendas tanto unifamiliares como plurifamiliares. Las viviendas unifamiliares constan de cocina, dos baños, tres dormitorios, salón-comedor, balcón y amplias zonas comunes. Los pisos disponen de lo mismo, pero con uno o dos dormitorios y un cuarto de baño. Además, existe posibilidad opcional de plaza de garaje y trastero (no incluidos en el precio). 

Cuentan con puerta de acceso con cerradura de seguridad, obra vista en el exterior. Carpintería exterior de aluminio gris oscuro, principalmente con hojas abatibles. Persianas enrollables exteriores en aluminio gris oscuro. Carpintería interior de madera maciza barnizada. Pavimento de gres en todas sus dependencias, salvo en las viviendas unifamiliares que es todo de parquet a excepción de cocinas y baños. Disponen de azulejo cerámico de primeras marcas en cocina y baños con falso techo en sus techos. Párquing suelo de hormigón fratasado pulido y pintado. 

Rodezno es una localidad que se sitúa en el noroeste de la provincia de La Rioja, muy cercano al municipio de Haro, bien comunicado con la carretera LR-207 donde concurre muy cerca la carretera nacional N-232 y la autopista AP-68, que comunican el municipio con el resto de la provincia y alrededores. Su actividad económica principal es la agricultura, destacando el cultivo del cereal, la remolacha y la vid.'}

{'es-ES': 'Bonito chalet adosado en una de las zonas más tranquilas de Logroño\xa0 con autobús urbano al centro de la ciudad.\xa0

Se distribuye\xa0en cuantro plantas;

Planta baja;

Merendero totalmente acondicionado con chimenea y garaje cerrado con espacio para dos coches y moto.

Planta primera;

Amplio salon con salida a jardin privado con asador,baño completo,cocina equipada y hool con salida a terraza delantera.

Planta segunda;

Tres habitaciones completas, y baño.

Ático:\xa0

Espacio diafano para crear un despacho o incluso otra habitacion.

Rodeado de amplias zonas de parques y paseos para disfrutar de la naturaleza.\xa0

QUIERES VERLO ?????

\xa0

\xa0

\xa0'}

{'es-ES': 'Duplex en el mejor sitio de Santo Domingo de la Calzada, edificio de dos vecinos muy familiar, su orientación fabulosa y el Duplex consta de: 1ª planta: Salón amplio con un ventanal todo lo que es fachada, cocina, habitación con salida a terraza con despensa y baño con ventana al exterior.

2ª planta: Habitación amplia con vistas maravillosas, dos habitaciones una con salida a terraza y despensa y baño con ventana\xa0 a exterior.\xa0

Se queda amueblado.'}

{'es-ES': 'En el corazón de la ciudad, vivienda de 3 dormitorios, salón, cocina equipada\xa0y dos baños con buenas vistas a la Plaza de Hermosilla

Ubicada en la tercera planta SIN ascensor, calefacción, suelos de gres, ventanas de madera con climalit, puertas de sapely. Sol de mañana y sol de tarde.

Llámanos y te lo enseñamos'}

