CONSTA DE UNA\xa0PLANTA BAJA CON UN AMPLIO Y SOLEADO SALÓN/ COCINA CON SALIDA DIRECTA AL JARDÍN, ASEO, DISTRIBUIDOR Y CUARTO\xa0 \xa0DE CALDERAS.

LA PRIMERA PLANTA CONSTA DE TRES DORMITORIOS, BAÑO Y COCINA, Y LA PLANTA BAJOCUBIERTA TIENE UN GRAN SALÓN, DOS DORMITORIOS Y UN BAÑO MAS.\xa0'}

{'es-ES': 'AMPLIO PISO CON TRES HABITACIONES, DOS BAÑOS, SALA Y COCINA,

