{'es-ES': 'EXCEPCIONAL CASA CON LAS MEJORES VISTAS DE LA ALDEA, RESTAURADA CON MIMO, EN LA ALDEA DE ZALDIERNA, A CINCO KMS DE EZCARAY\xa0Y A MENOS DE 15`DE LA ESTACIÓN DE ESQUÍ DE VALDEZCARAY.

UNA CASA IDEAL PARA CUALQUIERA QUE QUIERA DISFRUTAR DE LA NATURALEZA EN UNA DE LAS ALDEAS MÁS BONITAS DE EZCARAY\xa0Y PERFECTAMENTE COMUNICADA.

CONSTA DE TRES HABITACIONES, GRAN COCINA CON MESA DE COMEDOR, ESPECTACULAR SALÓN, DOS BAÑOS ZONA DE ESPARCIMIENTO INFERIOR, ZONA DE BIBLIOTECA Y UN TERRENO EXTERIOR CON POSIBILIDAD DE PONER UNA CASETA DE MADERA.'}

