{'es-ES': 'Para aquellos que desean vivir a un paso\xa0 del centro de Logroño\xa0\xa0con todos los servicios a tu alcance.

Consta de tres\xa0dormitorios, cocina totalmente\xa0amueblada\xa0y equipada con electrodomésticos y salida a terraza, amplio salón con salida a terraza y bonitas vistas a parque.

Además el precio incluye magnifico trastero de 11,81 m2 en bajo cubierta y plaza de garaje con segundo trastero.'}

