{'es-ES': 'El edificio se encuentra en un lugar privilegiado, al lado del Hotel Rural La Antigua Ferreria a 7 km. de Ezcaray y a 19 km de Valdezcaray. La vivienda muy bien aislada, ventanas con climalit. Edificio en piedra sin desentonar con el entorno.

Trastero incluido

\xa0'}

{'es-ES': 'PISO EN CALLE VITORIA MUY CÉNTRICO, ÚLTIMO PISO, MUY LUMINOSO. ASCENSOR Y PORTAL NUEVOS.

VIVIENDA DE 3 DORM., BAÑO CON DUCHA Y VENTANA, POSIBILIDAD DE ASEO, AMUEBLADO, EXTERIOR. CALEFACCIÓN INDIVIDUAL DE GAS. HAY PISO DEL PORTERO.

ASCENSOR, PORTAL, FACHADA Y TEJADO REFORMADOS. NO HAY DERRAMAS PENDIENTES. POCOS GASTOS DE COMUNIDAD.'}

{'es-ES': 'El unifamiliar, de tipo adosado, se compone de planta baja y una alzada. Con acceso exterior desde la calle se sitúan el garaje, el local-bodeguita y el trastero. En la planta baja de la vivienda se ubica el salón, la cocina y un aseo. En la planta primera están tres dormitorios y un baño completo. Todos los espacios habitables tienen orientación Sur y abren a un jardín privado, excepto uno de los dormitorios que tiene acceso a una gran terraza. 

La superficie total construida es de 192,55 m2. La superficie útil estricta de la vivienda es de 90 m2, la terraza en planta primera es de casi 22 m2, el trastero de 6 m2, garaje de 23 m2 y local-bodega de 16,40 m2. 

Los solados son de gres excepto la escalera de granito gris. Las carpinterías exteriores son de aluminio lacado y las interiores de madera pintada en blanco. Tanto la calefacción como el ACS se resuelven con una caldera con alimentación de gasóleo.'}

{'es-ES': 'Se trata de una edificación que consta de planta baja y tres alturas. Tiene una superficie de 468 m2, distribuidos en 346 m2 de vivienda. La planta baja se distribuye en bodega y aseo. La primera planta dispone de cocina, salón, 3 dormitorios y un baño. La segunda planta consta de 3 dormitorios, salón, cocina y baño. Y la tercera planta dispone de 3 dormitorios. La última reforma es de 1986. 

Calefacción individual de gasoil. Carpintería exterior de aluminio y madera.

No cobramos comisión al comprador.'}

{'es-ES': 'VIVIENDA TIPO DUPLEX EN EL CENTRO CON VISTAS DESPEJADAS, EN PLANTA SALA-COCINA CON TERRAZA , HABITACIÓN Y BAÑO. DOS HABITACIONES Y BAÑO EN BAJOCUBIERTA.

OPCIONAL POR 18.000€ UN AMPLIO GARAJE CERRADO CON TRASTERO.

QUEDA SEMI- AMUEBLADO'}

{'es-ES': 'Apartamento semiamueblado\xa0\xa0de\xa02 habitaciones y 1 baño en Cascajos con\xa0\xa0terraza de 10 metros con salida desde la cocina.\xa0\xa0Vistas a la urbanización y orientación sur.\xa0

Dispone de dos armarios empotrados , luces led domotizadas con temporizador y control por voz. Altura: 1º.\xa0

Garaje y trastero en el mismo edificio . Piscina y\xa0\xa0juegos infantiles.'}

{'es-ES': 'Piso distribuido en 4 alturas en la calle Mayor de Najera! 8 dormitorios, salón, 2 cocinas y 3 baños. Gran terraza. Preciosas vistas al rio y a la calle mayor. Vivienda muy peculiar. Infórmese!

Vivienda muy especial, son cuatro pisos distribuidos en cuatro plantas, comunicados entre si.

Ideal para inversores o para crear tu propio hogar en el centro de Nájera. Una vivienda única, con mucho encanto y que cuando la visites no te dejara indiferente.'}

