Disponemos de200 m2, distribuidos en5 dormitorios amplios, 3 baños completos, terraza con vistas a la céntrica calle, y una cocina enorme y amueblada. Es todo exterior, piso de lujo.

Cuenta con armarios empotrados. Suelo de parquet. Ventanas de aluminio. Terraza con metros, a dos pasos de Gran Vía.´'}

