'}

{'es-ES': 'Bloque Plurifamiliar ,vivienda en la planta primera. El edificio consta de planta sótano garaje, y 7 plantas altas para viviendas. La finca dispone de ascensor. La zona es muy tranquila , principalmente residencial, y nuestra vivienda es exterior y cuenta con una terraza con unas vistas esplendidas.
El activo esta localizado en la Calle Chile nº 34, 1ºE, Logroño. Zona centro cruce con c/ Duques de Nájera.

Edificio muy luminoso esquinero en una zona comercial (bancos, farmacias, eroski, etc.) y con amplia dotación de serivicios (colegios, ambulatorio Labradores…). \x0b\x0bA 5 minutos a pie de la Gran Vía Rey Juan Carlos I (avenida más comercial de Logroño y sede de multitud de ofertas de ocio y comerciales). \x0bParadas de autobús muy cerca, (líneas 4, 5, 10 y B1) '}

