{'es-ES': 'Maravillosa vivienda tipo dúplex, en pleno centro de Logroño, en una de las avenidas más atractivas de la ciudad. En una ubicación envidiable, y con un atractivo excepcional, por ser muy transitada, y con una amplia y rica oferta comercial y hostelera, al alcande de la mano, sin necesidad de desplazarse.

Se trata de una vivienda de  120 m2 con dos terrazas. Tres habitaciones, salón y 2 baño. Totalmente reformado. Amplio salón. Cocina salón. Opción de dos o tres habitaciones. Armarios empotrados. Garaje. Calefacción central de gas natural con contador individual.

¡HAY QUE VERLO!'}

